package cli

import (
	"errors"
)

// Error messages
var (
	ErrInvalidChar = errors.New("invalid character")
	ErrInvalidText = errors.New("invalid text: must be string or []byte")
)

// --------------------------------------------------------------------------- /
// Font definition
// --------------------------------------------------------------------------- /

// Font represents a ASCII art font,
// used for converting text to ASCII art.
type Font struct {
	Chars [][]byte
	Index []int
}

// Get returns the ASCII art for the given character,
// between 0x20 and 0x7e. If the character is not
// supported, an error is returned.
func (f *Font) Get(char byte) (b [][]byte, err error) {
	if char == 0x20 {
		return f.Space(), nil
	}
	if char > 0x20 && char <= 0x7e {
		n := make([][]byte, f.Height())
		start := f.Index[char-0x20-1]
		end := f.Index[char-0x20]
		for r := range n {
			n[r] = f.Chars[r][start+1 : end]
		}
		return n, nil
	}
	return nil, ErrInvalidChar
}

// Space returns the ASCII art for a space.
func (f *Font) Space() [][]byte {
	n := make([][]byte, f.Height())
	for i := range n {
		n[i] = []byte{0x20, 0x20, 0x20}
	}
	return n
}

// Height returns the height of the font.
func (f *Font) Height() int {
	return len(f.Chars)
}

// Render returns the ASCII art for the given text,
// with characters between 0x20 and 0x7e. If a character
// is not supported, it is replaced with a space.
func (f *Font) Print(bytes []byte) (art []byte) {
	if len(bytes) == 0 {
		return nil
	}
	var buf = make([][]byte, f.Height())
	for _, b := range bytes {
		c, err := f.Get(b)
		if err != nil {
			c = f.Space()
		}
		for i, l := range c {
			buf[i] = append(buf[i], l...)
		}
	}
	for i, l := range buf {
		if i > 0 {
			art = append(art, EOL...)
		}
		art = append(art, l...)
	}
	return
}

func (f *Font) Println(bytes []byte) []byte {
	return append(f.Print(bytes), EOL...)
}

func (f *Font) Sprint(s string) []byte {
	return f.Print([]byte(s))
}

func (f *Font) Sprintln(s string) []byte {
	return f.Println([]byte(s))
}

// --------------------------------------------------------------------------- /
// Fonts
// --------------------------------------------------------------------------- /

type fonts struct {
	Standard *Font
	Graffiti *Font
}

var Fonts = &fonts{
	Standard: standard,
	Graffiti: graffiti,
}

func renderFont(font *Font, text any) []byte {
	switch t := text.(type) {
	case string:
		return font.Sprint(t)
	case []byte:
		return font.Print(t)
	default:
		panic(ErrInvalidText)
	}
}

// Standard returns text in the standard ASCII art font.
func Standard(text any) []byte {
	return renderFont(Fonts.Standard, text)
}

// Graffiti returns text in the graffiti ASCII art font.
func Graffiti(text any) []byte {
	return renderFont(Fonts.Graffiti, text)
}

